INSERT INTO `berita` (`id`, `tgl`, `title`, `isi`, `updated_at`, `created_at`, `sumber`, `foto`, `tglkirim`, `ringkasan`, `pengirim`) VALUES
(24, '0000-00-00', 'Tim Penilai Adiwiyata Provinsi Lakukan Penilaian di MAN 1 Rohil', 'Bagansiapiapi : Tim Penilai Adiwiyata Provinsi Riau Asma Kardela melakukan penilaian Adiwiyata tingkat Provinsi Riau di Madrasah Aliyah Negeri (MAN) 1 Rokan Hilir (Rohil), Jum\'at (3/5/19) di Kantor Majelis guru MAN 1 Rohil Provinsi Riau Jalan Pulau Baru, Bagansiapiapi.\r\n\r\nAsma menjelaskan penilaian sekolah Adiwiyata tersebut berdasarkan Peraturan Dinas Lingkungan Hidup Provinsi Riau bekerjasama dengan Dinas Pendidikan Provinsi Riau.\r\n\r\n\"Disini ada 4 (empat) kriteria yang kita nilaikan yaitu kebijakan, kurikulum, partisipasi, sarana dan prasarana,\" jelasnya.\r\n\r\n\r\nAsma mengungkapkan, penilaian yang dilakukan akan di input pada sistem aplikasi data sehingga gambaran nilainya masih belum bisa diketahui.\r\n\r\n\"Nilai yang mencapai 64 keatas akan dipastikan meraih predikat Adiwiyata Provinsi sedangkan nilai yang mencapai 72 akan meraih predikat Adiwiyata nasional. Cuma peraturannya jika sekarang mengikuti Adiwiyata provinsi maka tahun depan baru bisa mengikuti Adiwiyata nasional,\" ujarnya.\r\n\r\nLanjutnya MAN 1 Rohil dengan adanya sarana-prasarana mendukung, kebijakan dan kekompakan guru mudah-mudahan diatas 75 nilainya.\r\n\r\nSementara Ketua Adiwiyata MAN 1 Rohil Desra Berliana S. Pd merasa plong setelah dinilai karena masalah yang selama ini dirasakan seperti masalah lingkungan yang kotor, banyak sampah. Dengan adanya penilaian ini sampah sudah terkoordinir sekarang.\r\n\r\n\"Sampah daun sama daun, kertas sama kertas, plastik sama plastik, sampai sekarang terkoordinir semua,\" ujarnya.\r\n\r\n\r\nLanjutnya kerja sama tim ini tentunya sangat mendukung untuk mencapai suksesnya penilaian Adiwiyata ini dan kami sangat menginginkan hasil yang terbaik sama seperti tahun yang kemaren tingkat Kabupaten kita mendapat nilai yang tertinggi dan tahun ini berharap juga mendapatkan nilai yang tertinggi.\r\n\r\nKepala Madrasah MAN 1 Rohil Hj Rahmawati M. Pdi sangat optimis bahwa MAN 1 Rohil bisa lolos Adiwiyata Provinsi. Karena melihat dari administrasi maupun persiapan secara fisik rasanya sudah dikerahkan segala kemampuan yang sebisanya, makanya timbul optimis bahwa itu membuahkan hasil seperti yang diharapkan.\r\n\r\nMelihat dari komentar tim penilaian tambahnya, bahwasanya MAN 1 Rohil sudah diberikan sinyal untuk bersiap-siap ke Adiwiyata Nasional.\r\n\r\n\"Mudah-mudahan ini semacam berkah dihari Jum\'at, dengan persiapan optimal lebih kurang satu bulan belakangan ini, dengan dukungan pihak DLH untuk menuju Adiwiyata ketingkat Nasional,\" harapnya.\r\n\r\n\r\nRahmawati mengucapkan terima kasih kepada semua pihak, dalam hal ini Komite, DLH terlebih yang menjembatani untuk penilaian ini, memberikan pengarahan dan sosialisasi, petunjuk bahkan bantuan berupa memberikan tanaman, memberikan bantuan mengomposan. Itu diantara bantuan DLH kepada MAN 1 Rohil.\r\n\r\nTambahnya kemudian dari Ketua KTNA Pak Alkahfi Sutisno, dari Kemenag Rohil dalam hal ini Pak Kasubbag TU yang menyumbangkan bambu 4 (empat)  batang, 2 (dua) bambu kuning dan 2 (dua) bambu hijau. Karena salah satu ikon penilaian Adiwiyata adalah harus adanya penanaman bambu karena bambu itu meredamkan kebisingan, dan meredam polusi.\r\n\r\nBerlanjut kemudian Kakanwil Kemenag Provinsi Riau Drs H Mahyudin MA memberikan satu pokok bibit durian muntong dari Malaysia. Kemudian Kabid Urais Drs H Afriyal Syah Lubis M. Pd menyumbangkan kepada MAN 1 Rohil satu pokok jambu bol Thailand dengan dititipkan ke Kasubbag TU Kemenag Rohil.\r\n\r\n\r\n\"Kemudian saya atas nama pribadi dan pimpinan Kepala MAN 1 Rohil mengucapkan ribuan terima kasih kepada majelis Guru, TU, Staf dan warga madrasah yang mau menghabiskan waktunya membantu mempersiapkan komponen pokja Adiwiyata ini,\" tuturnya.\r\n\r\nLanjutnya MAN 1 Rohil juga mendapatkan bantuan 13 truk tanah untuk penimbunan yaitu dari Bupati Rohil H Suyatno 6 truk tanah, Wakil Bupati Rohil Drs H Jamaludin yang juga sebagai Ketua Komite menyumbangkan 3 truk tanah, kemudian juga dari Bawaslu, BUMD, tokoh-tokoh masyarakat dan juga dari orang tua siswa.\r\n\r\n\"Bibit kami dibantu dari DLH Rohil dan juga alumni\" paparnya.\r\n\r\n\"Kemudian kepada semua pihak yang terlibat dan mendukung MAN 1 Rohil untuk Adiwiyata tingkat Provinsi saya mengucapkan ribuan terima kasih, hanya Allah SWT yang bisa membalas semua kebaikan Bapak/Ibuk,\" tutupnya.\r\n\r\n\r\nRRN/Rif', '2019-05-13', '2019-05-13', 'http://radarriaunet.com/news/detail/28288/tim-penilai-adiwiyata-provinsi-lakukan-penilaian-di-man-1-rohil.html?fbclid=IwAR0j47vBhH5PfQQKGfDj7X34mKWkEtmfv7zP8AUZtQrZLmBJBHGp1bLP39s#.XNHJaYAtU_0.faceboo', 'belajar/37470256164-foto_1.jpg', '13-5-2019', NULL, 'Faridh Julian'),
(25, '0000-00-00', 'PENGUMUMAN KELULUSAN MAN 1 ROKAN HILIR', 'Pengumuman kelulusan kelas XII tahun pelajaran 2018/2019 bisa di check pada link di bawah ini,lampiran tersedia\r\nhttps://drive.google.com/drive/u/2/folders/1EGp0bedhUbCUfnoTk7lv5dd5LhALafpq', '2019-05-13', '2019-05-13', 'https://drive.google.com/drive/u/2/folders/1EGp0bedhUbCUfnoTk7lv5dd5LhALafpq', 'belajar/SK kelulusan MAN 1 ROKAN HILIR(1)-1.jpg', '13-5-2019', NULL, 'Faridh Julian');
